import React from 'react';
import NavBar from './home/Navbar';
import Footer from './home/Footer';
function SignUp()
{
    return(
        <div>
        <NavBar/>
        <div id="signupform">
        </div>
        <div id="signin">
        </div>
        <Footer/>
        </div>

    )
}
export default SignUp;
